INSERT INTO multimedias VALUES(175,'Nick Kroll y John Mulaney: Oh, Hello on Broadway    ',1,'   1 hora, 42 min.',48,'El Sunnyv rivalidades y la delincuencia están al orden del día pero en la que también es posible formar una familia tener amigos y encontrar el amor... siempre y cuando tenga uno claro que la familia le va a hacer la vida imposible el amor le va a amargar la existencia y los amigos acabarán por llevarle a la tumba.');
INSERT INTO multimedias VALUES(176,'Marco Luque: Tamo Junto     ',2,'   1 hora, 13 min.',35,'Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clásicos canciones de cuna y mitos griegos que estudian en una escuela-internado llamada Ever After High. En algunos casos los libros son escritos por Suzanne Selfors pero la mayoría de ellos suelen ser escritos por Hale ya que originalmente es la autora de la serie. Técnicamente no es una serie de televisión en los Estados Unidos ya que es una serie Web. Sin embargo la serie es transmitida en la televisión de Francia por el canal infantil francés Gulli. Ever After High es considerada apta para todo el público');
INSERT INTO multimedias VALUES(177,'Rory Scovel Tries Stand-Up for the First Time       ',3,'   1 hora, 6 min.',33,'En  convirtió en un especial de televisión británica en 2004. Desde 2003 hasta 2004 Martin escribió para Late Night with Conan O Brien. En 2004 Martin tenía su propio Comedy Central Presents Stand-up especial. Su especial se divide en tres partes. En la primera se realiza en forma tradicional stand-up');
INSERT INTO multimedias VALUES(178,'Chris DElia: Man On Fire    ',3,'   1 hora, 5 min.',98,'Burnham solicitó entrar en la Universidad del sur de California la prestigiosa Universidad de Yale3? aunque fue aceptado en la Universidad de Nueva York5? en la escuela de artes. Bo dijo que el primer año de universidad se quería morir mientras veía como sus antiguos amigos montaban fiestas. En una entrevista de 2011 dijo que llevaba con su novia 5 años');
