INSERT INTO series VALUES(1,'Crouching Tiger, Hidden Dragon: Sword of Destiny   ',0,'   1 hora, 43 min.',81,'Antes de meterse en el mundo de la comedia estuvo trabajando en una compañía telefónica de Los Ángeles. Su familia le pidió que siguiera en su puesto para poder mantenerse económicamente sin embargo decidió dar un paso adelante a pesar de los riesgos que acarrearía su mala situación económica puesto que acabó perdiendo su casa y el coche',13);
INSERT INTO series VALUES(2,'The Fundamentals of Caring ',2,'   1 hora, 37 min.',35,'BoJack Horsemg para la plataforma digital Netflix. Trata la historia de BoJack un caballo antropomorfo que triunfó en los años 1990 con una telecomedia y que actualmente es incapaz de reconducir su vida profesional y personal. A través de un marco ambientado en el mundo del espectáculo de Hollywood los episodios abordan complejos conflictos personales y tienen un hilo narrativo serializado',12);
