INSERT INTO documentales VALUES(156,'Daniel Sosa: Sosafado      ',4,'   1 hora, 17 min.',49,'Su particular estilo divertido y animado lo ha convertido en uno de los comediantes más exitosos con eventos con boletos agotados en todo el mundo inclusive agotando boletos en Madison Square Garden y el Microsoft Theater. Además es unos de los comediantes más vistos en YouTube con más de 300 millones de vistas',16);
INSERT INTO documentales VALUES(157,'Beppe Grillo: Grillo vs. Grillo    ',3,'   1 hora, 35 min.',85,'Un dí consigue acompañarles y juntos se dirigen al imperio de Kublai Khan. Penurias y privaciones marcan el camino hasta que finalmente tras varios años logran llegar a Mongolia y a la corte del Gran Khan. Allí se gana el respeto de Kublai se hace amigo de Chinkin el hijo de Kublai Khan quien sufre de epilepsia',6);
