INSERT INTO documentales VALUES(159,'Trevor Noah: Afraid of the Dark    ',2,'   1 hora, 7 min.',68,'BoJack Horsemg para la plataforma digital Netflix. Trata la historia de BoJack un caballo antropomorfo que triunfó en los años 1990 con una telecomedia y que actualmente es incapaz de reconducir su vida profesional y personal. A través de un marco ambientado en el mundo del espectáculo de Hollywood los episodios abordan complejos conflictos personales y tienen un hilo narrativo serializado',15);
